import React from 'react'
import Manifest from './manifest.json'

const Section = (data) => {
    var i = data.data
    return (
    <div className=''>
        <div className='font-extrabold text-base  mb-2 opacity-90 md:text-lg'>{i.name}</div>
        <div className='font-normal text-base opacity-80'>{i.name}</div>
    </div>
    )
}

const Tokenomics = () => { 
    return (
    <div className='grid md:grid-flow-col text-white p-7 md:gap-x-10 bg-black'>
        <div className='grid grid-flow-row mb-7'>
            <div className='font-extrabold text-sm opacity-50 mb-9'>{Manifest.heading}</div>
        </div>
        <div className='bg-white bg-opacity-10 rounded-xl p-5'>
            {Manifest.cards.map((i, key) => {
                return <div><Section key={key} data={i}/></div>;
                })}
        </div>
    </div>
    )
}

export default Tokenomics
